import React, { Component } from 'react';
import './Hello.css';

class Hello extends Component{
	render() {
	return (
	<div class='f1 tc'>
		<h1> Hello world </h1>
		<p> Welcome to react </p>
	</div>
	)
	}
}

export default Hello;
